// Import the necessary styles globally
import '@telegram-apps/telegram-ui/dist/styles.css';

// Import components from the library
import {
  Avatar,
  Button,
  Cell,
  CompactPagination,
  Section,
  Tabbar,
} from "@telegram-apps/telegram-ui";
import { useState } from "react";
import Image from "next/image";
import { useThemeParams } from "@telegram-apps/sdk-react";
import { CompactPaginationItem } from "@telegram-apps/telegram-ui/dist/components/Navigation/CompactPagination/components/CompactPaginationItem/CompactPaginationItem";

export default function Home() {
  const { accentTextColor, bgColor, secondaryBgColor, buttonColor } =
    useThemeParams();
  const tabs = [
    { id: 1, text: "Play", icon: "game_28" },
    { id: 2, text: "Learn", icon: "mdi_learn-outline" },
    { id: 3, text: "Frens", icon: "group_24" },
  ];
  const [currentTab, setCurrentTab] = useState(tabs[0].id);
  return (
    <div style={{ backgroundColor: secondaryBgColor }}>
      {currentTab === 1 ? (
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            paddingTop: 20,
            paddingBottom: 20,
          }}
        >
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-around",
              alignItems: "center",
            }}
          >
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "center",
                gap: 8,
                alignItems: "center",
                background: bgColor,
                width: "100px",
                height: "46px",
                borderRadius: 10,
              }}
            >
              <Avatar src="/images/avatar.png" size={24} />
              Ehsan
            </div>
            <div>
              <Image
                src="/images/newton-logo.png"
                width={68}
                height={74}
                alt={"Newton"}
              />
            </div>
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "center",
                gap: 8,
                alignItems: "center",
                background: bgColor,
                width: "100px",
                height: "46px",
                borderRadius: 10,
              }}
            >
              <Avatar src="/images/score-avatar.png" size={24} />
              45630
            </div>
          </div>
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              backgroundColor: buttonColor,
              height: "180px",
              width: "100vw",
              padding: 20,
              gap: 10,
            }}
          >
            <div
              style={{
                flexGrow: 1,
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-between",
                width: "60%",
              }}
            >
              <span style={{ fontSize: 30, fontWeight: "bold" }}>
                How to play?
              </span>
              <Button
                style={{
                  backgroundColor: "white",
                  color: "black",
                }}
              >
                How?
              </Button>
            </div>
            <CompactPagination
              style={{
                alignSelf: 'center',
                color: 'white',
              }}
            >
              <CompactPaginationItem
                onClick={function noRefCheck() {}}
                selected
              >
                1
              </CompactPaginationItem>
              <CompactPaginationItem
                onClick={function noRefCheck() {}}
              >
                2
              </CompactPaginationItem>
              <CompactPaginationItem
                onClick={function noRefCheck() {}}
              >
                3
              </CompactPaginationItem>
              <CompactPaginationItem
                onClick={function noRefCheck() {}}
              >
                4
              </CompactPaginationItem>
              <CompactPaginationItem
                onClick={function noRefCheck() {}}
              >
                5
              </CompactPaginationItem>
            </CompactPagination>
          </div>
          <div>Games</div>
        </div>
      ) : currentTab == 2 ? (
        <div>Learn</div>
      ) : (
        <div>Frens</div>
      )}
      <Tabbar>
        {tabs.map(({ id, text, icon }) => (
          <Tabbar.Item
            key={id}
            text={text}
            selected={id === currentTab}
            onClick={() => setCurrentTab(id)}
          >
            <Image
              src={`/images/${icon}.svg`}
              width={28}
              height={28}
              alt={text}
            />
          </Tabbar.Item>
        ))}
      </Tabbar>
    </div>
  );
}
